import React from "react";
import Home from "./components/pages/Home";
import Products from "./components/pages/Products";
import Contactus from "./components/pages/Contactus";
import Marketing from "./components/pages/Marketing";
import Consulting from "./components/pages/Consulting";
import Design from "./components/pages/Design";
import Development from "./components/pages/Development";
import Python from "./components/pages/Python";
import Webdev from "./components/pages/Webdev";
import Automation from "./components/pages/Automation";
import Java from "./components/pages/Java";
import Sql from "./components/pages/Sql";
import Navbar from "./components/Navbar";
import { BrowserRouter, Route, Routes } from "react-router-dom";
function Rout() {
  return (
    <div>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/home" exact Component={<Home />}></Route>
          <Route path="/contactus" Component={<Contactus />}></Route>
          <Route path="/products" Component={<Products />}></Route>
          <Route path="/marketing" Component={<Marketing />}></Route>
          <Route path="/consulting" Component={<Consulting />}></Route>
          <Route path="/design" Component={<Design />}></Route>
          <Route path="/development" Component={<Development />}></Route>
          <Route path="/automation" Componentt={<Automation />}></Route>
          <Route path="/sql" Component={<Sql />}></Route>
          <Route path="/python" Component={<Python />}></Route>
          <Route path="/java" Component={<Java />}></Route>
          <Route path="/webdevelopment" Component={<Webdev />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}
export default Rout;
